export const LOGINED_DATA = 'LOGINED_DATA'
export const USER_DATA = 'USER_DATA'
export const BOOKING_STATUS = {
  new: 'NEW',
  canceled: 'CANCELLED',
  waiting: 'WAITING',
  processing: 'PROCESSING',
  done: 'DONE',
}
export const BOOKING_STATUS_ACTION = { inprogress: 'INPROGRESS', cancel: 'CANCELLED', done: 'DONE' }
export const TECH_STATUS = { inactive: 'INACTIVE', active: 'ACTIVE' }
export const SEAT_STATUS = { busy: 'BUSY', available: 'AVAILABLE', inactive: 'INACTIVE' }
export const SERVICE_STATUS = { inactive: 'INACTIVE', active: 'ACTIVE' }
export const TIME_SALON = { open: 8, close: 20 }
export const TECH_ID_DEFAULT = null
export const SERVICE_TYPE = { services: 'SERVICES', addons: 'ADDONS', products: 'PRODUCTS' }
